//====================== Game Configuration ========================
void hw_write_bits(volatile int * addr, volatile int unmask, volatile int value)
{
    *addr = ((~unmask) & *addr) | value;
}

void config_GIC() { 
    if(DEBUG)
        printf("config_GIC \n");

    config_interrupt ((int)PS2_IRQ, 1); // configure the keyboard ps2 parallel port (Interrupt ID = 79) 
    config_interrupt((int)KEY_IRQ, 1); // configure the Key
	config_interrupt((int)TIMER_IRQ, 1); // configure the timer
    // Set Interrupt Priority Mask Register (ICCPMR). Enable all priorities
	*((int *) 0xFFFEC104) = 0xFFFF;

	// Set CPU Interface Control Register (ICCICR). Enable the signaling of interrupts===
	*((int *) 0xFFFEC100) = 1; // enable = 1

	// Configure the Distributor Control Register (ICDDCR) to send pending interrupts to CPUs
	*((int *) 0xFFFED000) = 1; // enable = 1

}

void config_PS2(){
	if(DEBUG)
        printf("config_PS2 \n");

	volatile int* PS2_base_ptr = (int*) PS2_BASE;               //PS2 DATA register
    *(PS2_base_ptr) = 0xFF;                                     // Reset the data register of the PS2
	*(PS2_base_ptr +1) = 1;                                     //writes 1 into RE bit in PS2_Control register to enable interrupts;	
	
}

/* setup the KEY interrupts in the FPGA */
void config_KEYs() {
    volatile int *KEY_ptr = (int *) KEY_BASE; // pushbutton KEY address
    *(KEY_ptr + 2) = 0xF;                    // enable interrupts for all KEYs
}

void config_Timer() {
	*(priv_timer_ptr) = (long int) 200000000;  // Set the timer to 60 seconds
	*(priv_timer_ptr + 3) = 1; 
	*(priv_timer_ptr + 2) = 0b110;
}

void config_interrupt (int int_ID, int CPU_target)
{
    int n, addr_offset, value, address;
    /* Set Interrupt Processor Targets Register (ICDIPTRn) to cpu0.
     * n = integer_div(int_ID / 4) * 4
     * addr_offet = #ICDIPTR + n
     * value = CPU_target << ((int_ID & 0x3) * 8)
     */
    n = (int_ID >> 2) << 2;
    addr_offset = ICDIPTR + n;
    value = CPU_target << ((int_ID & 0x3) << 3);

    /* Now that we know the register address and value, we need to set the correct bits in
     * the GIC register, without changing the other bits */
    address = MPCORE_GIC_DIST + addr_offset;
    hw_write_bits((int *) address, 0xff << ((int_ID & 0x3) << 3), value);

    /* Set Interrupt Set-Enable Registers (ICDISERn).
     * n = (integer_div(in_ID / 32) * 4
     * addr_offset = 0x100 + n
     * value = enable << (int_ID & 0x1F) */
    n = (int_ID >> 5) << 2;
    addr_offset = ICDISER + n;
    value = 0x1 << (int_ID & 0x1f);
    /* Now that we know the register address and value, we need to set the correct bits in
     * the GIC register, without changing the other bits */
    address = MPCORE_GIC_DIST + addr_offset;
    hw_write_bits((int *) address, 0x1 << (int_ID & 0x1f), value);
}

/* Turn on interrupts in the ARM processor */ 
void enable_A9_interrupts(void) {

    int status = 0b01010011;
    __asm__("msr cpsr, %[ps]" : : [ps]"r"(status)); 
}

/* 
 * Initialize the banked stack pointer register for IRQ mode
*/
void set_A9_IRQ_stack(void)
{
	int stack, mode;
	stack = A9_ONCHIP_END - 7;		// top of A9 onchip memory, aligned to 8 bytes
	/* change processor to IRQ mode with interrupts disabled */
	mode = 0b11010010;
	__asm__("msr cpsr, %[ps]" : : [ps] "r" (mode));
	/* set banked stack pointer */
	__asm__("mov sp, %[ps]" : : [ps] "r" (stack));

	/* go back to SVC mode before executing subroutine return! */
	mode = 0b11010011;
	__asm__("msr cpsr, %[ps]" : : [ps] "r" (mode));
}

void config_buffer()
{
	    //====================== VGA Buffer setup ========================
    
    // Point to the front buffer register
    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the back buffer

    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();

    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer

    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;

    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
};


//====================== Interrupt Exception Handler ========================
void __attribute__ ((interrupt)) __cs3_isr_irq (void)
{
	// Read the ICCIAR from the processor interface 
	int address = MPCORE_GIC_CPUIF + ICCIAR; 
	int int_ID = *((int *) address); 
   
	if (int_ID == (int)PS2_IRQ)				// check if interrupt is from the PS/2
		PS2_ISR();
	else if(int_ID == (int) KEY_IRQ)
        KEY_ISR();
	else if(int_ID == (int) TIMER_IRQ)
		TIMER_ISR();
    else
		while (1);									// if unexpected, then stay here

	// Write to the End of Interrupt Register (ICCEOIR)

    *((int *) 0xFFFEC110) = int_ID;

	return;
} 

