void PS2_ISR() 
{
    volatile int * PS2_base_ptr = (int *) PS2_BASE;		        // PS/2 port base address
    int PS2_data, RAVAIL, RVALID;

    PS2_data = *(PS2_base_ptr);									// read the Data register in the PS/2 port
    RAVAIL = (PS2_data & 0xFFFF0000) >> 16;			        // extract the RAVAIL field

    RVALID = PS2_data & 0x8000;



    //if (RAVAIL > 0 && RVALID != 0)
	 if ( RVALID != 0)
    {
        
        byte1 = byte2;           // Save the last three bytes of the PS2 data register                               
        byte2 = byte3;                                          
        byte3 = PS2_data & 0xFF;                                //Check which key on the keyboard is pressed


       if((byte3 == (char) 0x6B) && byte2 == (char) 0xF0)
       {                  //Check which key trigger the interrupt
         	is_left_key_down = false;
             //*led_base_address = 1;
            return;
        } else if((byte3 == (char) 0x74) && byte2 == (char) 0xF0)
        {
            is_right_key_down = false;
            //game_state = GAME_END;
            return;
        } 
        else if((byte3 == (char) 0x29) && byte2 == (char) 0xF0)
        {
            is_space_key_down = false;
            switch (game_state)
            {
            case GAME_START:
                game_state = GAME_HELP;
                break;
            case GAME_HELP:
                game_state = GAME_PLAY;
            
            default:
                break;
            }
            return;
        } else 
        {
       if(byte3 == (char) 0x6B){
            is_left_key_down = true;
            switch (game_state){
                case GAME_PLAY:
				prev_prev_basket_x_pos = prev_basket_x_pos;
        		prev_basket_x_pos = basket_x_pos;
                    if(basket_x_pos >= 0)
                        if(basket_x_pos - basket_move_speed >=0)
                            basket_x_pos -= basket_move_speed;
                        else
                            basket_x_pos = 0;
                    draw_new_pos_basket(); // Everytime the basket is moved, the new position is drawn
                    
                    break;
                default:
                    break;
            }
            //*led_base_address = 0;
       } 
       
       if(byte3 == (char) 0x74){
            is_right_key_down = true;
            switch (game_state){
                case GAME_PLAY:
				prev_prev_basket_x_pos = prev_basket_x_pos;
        		prev_basket_x_pos = basket_x_pos;
                    if(basket_x_pos < RESOLUTION_X - BASKET_WIDTH)
                        if(basket_x_pos + basket_move_speed + BASKET_WIDTH < RESOLUTION_X)
                            basket_x_pos += basket_move_speed;
                        else
                            basket_x_pos = RESOLUTION_X - BASKET_WIDTH;
                    draw_new_pos_basket(); // Everytime the basket is moved, the new position is drawn
                    break;
                default:
                    break;
            }
        }

        if(byte3 == (char) 0x29){
            is_space_key_down = true;
            
        }
        }


    
            
    }

    
}

void KEY_ISR(void) {
    volatile int *KEY_ptr = (int *) KEY_BASE;
    int press;
    press = *(KEY_ptr + 3); // read the pushbutton interrupt register
    *(KEY_ptr + 3) = press; // Clear the interrupt
    if(game_state == GAME_END)
    {
        game_state = GAME_START;
    }

	if(game_state == GAME_PLAY)
	{
		game_state = GAME_END;
	}

    return;
}

void TIMER_ISR(void) {
    //plot_text(300,0,"Stopppppp");
	*(priv_timer_ptr + 3) = 1;  // Reset the interrupt flag
	game_timer --;
	if (game_timer <= 0)
	{
		game_state = GAME_END;
		stopTimer();
	}
	int oneth_digit = game_timer % 10;
	int tenth_digit = (game_timer / 10);

	
	
	int displayNum = (hex_display_number[tenth_digit] << 8 ) | hex_display_number[oneth_digit];
	*(hex4_5_base_address) = displayNum;
	
    return;
}

