void display_score_on_hex_display(int score)
{

	// If the player score over 999, then display 999 and end the game
	if (score >= 999)
	{
		game_state = GAME_END;
		score = 999;
	}

	if (score < 0)
	{
		game_state = GAME_END;
		score = 0;
	}

	int oneth_digit = score % 10;
	int tenth_digit = (score / 10) % 10;
	int hundredth_digit = (score / 100) % 10;

	
	
	int displayNum = (hex_display_number[hundredth_digit] << 16 ) | (hex_display_number[tenth_digit] << 8 ) | hex_display_number[oneth_digit];
	*(hex0_3_base_address) = displayNum;
}


