// draws a line from (x0, y0) to (x1, y1) with colour "line_color"
void draw_line(int x0, int y0, int x1, int y1, int line_color){
    int is_steep = ABS(y1 - y0) > ABS(x1 - x0);

    if(is_steep == TRUE)
    {
        swap(&x0,&y0);
        swap(&x1,&y1);
    }

    if(x0 > x1)
    {
        swap(&x0,&x1);
        swap(&y0,&y1);
    }

    int deltax = x1 - x0;
    int deltay = ABS(y1 - y0);
    int error = -(deltax / 2);
    int y = y0;

    int y_step = y0 < y1 ? 1:-1; 

    for(int x = x0; x <= x1; ++x)
    {
        if(is_steep == TRUE)
        {
            plot_pixel(y,x,line_color);
        }
        else
        {
            plot_pixel(x,y,line_color);
        }
    error = error + deltay;
    if (error > 0)
    {
        y = y + y_step;
        error = error - deltax;
    }
    }
    
}


// the helper function used in drawLine function
void swap(int* n1, int* n2)
{
    int temp;
    temp = *n1;
    *n1 = *n2;
    *n2 = temp;
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

// check if swap completed, i.e. S bit = 0
int swapCompleted(int bufferStatus){
    
    int s_bit = bufferStatus << 31;
    if(s_bit == 0)
        return TRUE;
    
    return FALSE;

}

// after this function has been executed, it means we are ready to swap.
void wait_for_vsync(){
   volatile int *pixel_ctrl_ptr = (int *) 0xff203020;
   int status;

   // launch the swap process
   *pixel_ctrl_ptr = 1; // sets s bit = 1

   // poll the status bit
   status = *(pixel_ctrl_ptr + 3);
   while ((status & 0x1) != 0){
       status = *(pixel_ctrl_ptr + 3);
   }

   // status bit s = 0
}


